import React from "react"
import "../../../CSS/ConfirmationScreen.css"

const ConfirmationScreen = ({chosenQuestion}) => {

    return (
        <div className="questionsPopUpContainer">
            <div className="confirmationPopUp">
                <p>Awesome, you just started a conversation with {chosenQuestion.firstName} {chosenQuestion.lastName}</p>
                <i className="fas fa-check"></i>
            </div>
        </div>
    )
}

export default ConfirmationScreen
